import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Bar } from 'react-chartjs-2';
import { Chart, CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend } from 'chart.js';

Chart.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);

function Dashboard() {
  const [commissionData, setCommissionData] = useState(null);
  const [violationsData, setViolationsData] = useState(null);
  const [commissionHistory, setCommissionHistory] = useState([]);
  const [filter, setFilter] = useState('YTD');
  const [showDetails, setShowDetails] = useState(false);
  const [showQualifications, setShowQualifications] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const userEmail = localStorage.getItem('userEmail');
    if (!userEmail) {
      navigate('/');
      return;
    }

    const fetchData = async () => {
      const response = await fetch(`https://us-central1-optimal-comfort-464220-t1.cloudfunctions.net/loginHandler?email=${userEmail}`);
      const result = await response.json();
      if (result.success) {
        setCommissionData(result.commissionData);
        setViolationsData(result.violationsData);
        setCommissionHistory(result.commissionHistory || []);
      } else {
        alert("Failed to fetch data");
      }
    };

    fetchData();
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('userEmail');
    navigate('/');
  };

  if (!commissionData || !violationsData) return <div>Loading...</div>;

  const agentFirstName = commissionData.agentname ? commissionData.agentname.split(" ")[0] : "Agent";
  const weekStart = commissionData.week_start_date || "N/A";
  const weekEnd = commissionData.week_end_date || "N/A";

  // ‚úÖ Filtered commission history
  const filteredHistory = commissionHistory.filter(item => {
    const dateStr = item.week_start_date;
    if (!dateStr) return false;

    const itemDate = new Date(dateStr);
    const now = new Date();

    if (filter === 'Weekly') {
      const oneWeekAgo = new Date();
      oneWeekAgo.setDate(now.getDate() - 7);
      return itemDate >= oneWeekAgo;
    } else if (filter === 'Monthly') {
      const oneMonthAgo = new Date();
      oneMonthAgo.setMonth(now.getMonth() - 1);
      return itemDate >= oneMonthAgo;
    } else {
      // YTD
      return itemDate.getFullYear() === now.getFullYear();
    }
  });

  // ‚úÖ Commission history chart data
  const chartLabels = filteredHistory.map(item => {
    const start = item.week_start_date || 'N/A';
    const end = item.week_end_date || 'N/A';
    return `${start} - ${end}`;
  });

  const chartValues = filteredHistory.map(item => {
    const value = item["commissionafterarfeescanningviolations"];
    return typeof value === "string" ? parseFloat(value.replace(/[$,]/g, '')) || 0 : value || 0;
  });

  const commissionChartData = {
    labels: chartLabels,
    datasets: [
      {
        label: 'Commission ($)',
        data: chartValues,
        backgroundColor: '#d32f2f',
      }
    ],
  };

  // ‚úÖ Calculate total YTD commission
  const totalYTD = commissionHistory.reduce((acc, cur) => {
    const val = cur["commissionafterarfeescanningviolations"];
    const num = typeof val === "string" ? parseFloat(val.replace(/[$,]/g, '')) || 0 : val || 0;
    return acc + num;
  }, 0).toFixed(2);

  return (
    <div style={{ fontFamily: "Arial, sans-serif", backgroundColor: "#f9f9f9", minHeight: "100vh" }}>
      {/* üî¥ Header */}
      <div style={{ backgroundColor: "#d32f2f", color: "#fff", display: "flex", alignItems: "center", justifyContent: "space-between", padding: "10px 20px" }}>
        <div style={{ display: "flex", alignItems: "center" }}>
          <img src="/fiesta-logo.png" alt="Fiesta Logo" style={{ height: "40px", marginRight: "10px" }} />
          <h1 style={{ margin: 0 }}>Welcome, {agentFirstName}</h1>
        </div>
        <button onClick={handleLogout} style={{ backgroundColor: "#fff", color: "#d32f2f", border: "none", padding: "5px 10px", cursor: "pointer", borderRadius: "3px" }}>Logout</button>
      </div>

      {/* ‚úÖ Main layout */}
      <div style={{ display: "flex", padding: "20px", gap: "20px" }}>
        {/* üìù Weekly Commission */}
        <div style={{ flex: 1, backgroundColor: "#fff", border: "1px solid #ddd", borderRadius: "5px" }}>
          <div style={{ backgroundColor: "#d32f2f", color: "#fff", padding: "10px", fontWeight: "bold", borderRadius: "5px 5px 0 0" }}>
            Weekly Commission | {weekStart} - {weekEnd}
          </div>
          <div style={{ padding: "10px" }}>
            {/* Existing commission details here */}
            <p><strong>Agent Name:</strong> {commissionData.agentname}</p>
            <p><strong>Region:</strong> {commissionData.region}</p>
            {/* ... all other commission fields ... */}
            <p><strong>Total Commission:</strong> {commissionData.commissionafterarfeescanningviolations}</p>

            <div style={{ display: "flex", gap: "10px", marginTop: "10px" }}>
              <button onClick={() => setShowDetails(!showDetails)} style={{ backgroundColor: "#d32f2f", color: "#fff", border: "none", padding: "5px 10px", cursor: "pointer", borderRadius: "3px" }}>
                {showDetails ? "Hide Other Details" : "Show Other Details"}
              </button>
              <button onClick={() => setShowQualifications(!showQualifications)} style={{ backgroundColor: "#d32f2f", color: "#fff", border: "none", padding: "5px 10px", cursor: "pointer", borderRadius: "3px" }}>
                {showQualifications ? "Hide Qualifications" : "Commission Qualifications"}
              </button>
            </div>

            {showDetails && (
              <div style={{ marginTop: "10px", fontSize: "14px" }}>
                {Object.entries(commissionData).map(([key, value]) => (
                  <div key={key}>
                    <strong>{key}:</strong> {value || "N/A"}
                  </div>
                ))}
              </div>
            )}

            {showQualifications && (
              <div style={{ marginTop: "10px", backgroundColor: "#f1f1f1", padding: "10px", borderRadius: "5px", fontSize: "14px", lineHeight: "1.5" }}>
                <h3>Commission Qualifications</h3>
                {/* Qualification list here */}
              </div>
            )}
          </div>
        </div>

        {/* üìà Commission History */}
        <div style={{ flex: 1, backgroundColor: "#fff", border: "1px solid #ddd", borderRadius: "5px" }}>
          <div style={{ backgroundColor: "#d32f2f", color: "#fff", display: "flex", justifyContent: "space-between", alignItems: "center", padding: "10px", fontWeight: "bold", borderRadius: "5px 5px 0 0" }}>
            üìà Commission History
            <select value={filter} onChange={(e) => setFilter(e.target.value)} style={{ borderRadius: "3px", padding: "2px 5px" }}>
              <option value="Weekly">Weekly</option>
              <option value="Monthly">Monthly</option>
              <option value="YTD">YTD</option>
            </select>
          </div>
          <div style={{ padding: "10px" }}>
            <Bar data={commissionChartData} options={{ responsive: true, plugins: { legend: { display: false }, title: { display: true, text: 'Commission History' } } }} />
            <div style={{ marginTop: "10px", fontWeight: "bold" }}>
              Total Commission YTD: ${totalYTD}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
